// Extended Ajax Example for CSE 264
// J. Femister

let express = require("express");
let path = require("path");

let app = express();

// Setup static file loading for the index.html file in the public folder
let publicPath = path.resolve(__dirname, "public");
app.use(express.static(publicPath));

let zips = {};

app.get("/getstatelist", (req, res) => {
  let states = {};
  // Pull each of the 33k zip code records out of the zips object and use each state name
  // to create a property in the new states object, so that each state will be used just once.
  for (z in zips) {
    let obj = zips[z];
    states[obj.state] = 1; // Each state name will be used many times, but will reuse the same property.
  }
  // Push each of the state names onto an array
  let stateList = [];
  for (s in states) stateList.push(s);
  // Sort the array of state names, convert it to JSON format and send back to the browser
  res.end(JSON.stringify(stateList.sort()));
});

app.get("/lookupzipcode", (req, res) => {
  // Look up a record in the zips array by its zip code, JSON encode the object and send it back to the browser
  res.end(JSON.stringify(zips[req.query.zip]));
});

// Start the app listening on port 3000
app.listen(3000, () => console.log("Starting up Extended Ajax Example"));

